import React from "react";

const Header = () => {
  return (
    <header>
      <div className="navbar">
        <div className="logo">
          <img src="../assets/images/logo.png" width="130" height="49" alt="" />
        </div>
        <ul className="nav-list">
          <li>
            <a href="#">CATEGORIES</a>
            <a href="#">GUIDES</a>
            <a href="#">WORDPRESS HOSTING</a>
            <a href="#">MANAGED HOSTING</a>
            <a href="#">COUPONS</a>
          </li>
        </ul>
      </div>
    </header>
  );
};

export default Header;
